import React, {useEffect} from 'react'
import {Nav} from 'react-bootstrap';
import { Link } from 'react-router-dom'
import { SET_AUTH_USER } from '../store/auth';
import { useStore } from '../store/store';


export const Header = (authUser) => {
  const [{ auth }, dispatch] = useStore();
  console.log(auth);
  useEffect(() => {
    dispatch({ type: SET_AUTH_USER, payload: authUser });
  }, [dispatch, authUser]);
// 
    const headers = auth.authUser ? (
      <Nav fill className="justify-content-space-beetwin"  as="ul">
        <Nav.Item as="li">
          <Nav.Link name='logout' onClick={'logout'}>LogOut</Nav.Link>
        </Nav.Item>
      </Nav>
    ) : (
      <Nav fill className="justify-content-space-beetwin" defaultActiveKey="" variant="pills" as="ul">
        <Nav.Item as="li">
          <Nav.Link 
            as={Link}
            to='/signin'
            eventKey="1"
          >
          Sign In
          </Nav.Link>
        </Nav.Item>
        <Nav.Item as="li">
          <Nav.Link 
            as={Link}
            to='/signup'
            eventKey="2"
          >
          Sign Up
          </Nav.Link>
        </Nav.Item>
      </Nav>
    );

    return (
      <header  className="align-items-center ">
        {headers}
      </header>
    )
}
